"""
Problem Description
You are given an integer array A. You have to find the second largest element/value in the array or report that no such element exists.
"""

"""
Problem Constraints
1 <= |A| <= 105

0 <= A[i] <= 109
"""

"""
Input Format
The first argument is an integer array A.
"""

"""
Output Format
Return the second largest element. If no such element exist then return -1.
"""

"""
Example Input
Input 1:

 A = [2, 1, 2] 
Input 2:

 A = [2]
"""

"""
Example Output
Output 1:

 2 
Output 2:

 -1 
"""

"""
Example Explanation
Explanation 1:

 First largest element = 2
 Second largest element = 2
 Third largest element = 1

Explanation 2:

 There is no second largest element in the array.
"""

class Solution:
    # @param A : list of integers
    # @return an integer
    def solve(self, A):
        l = len(A)
        # return l
        if l == 1:
            return -1

        secondLargest = -1
        largest = A[0]
        # print(largest,secondLargest)
        for index,ele in enumerate(A):
            if index == 0:
                continue
            # print(largest,secondLargest,ele)
            if largest <= ele:
                secondLargest = largest
                largest = ele
            elif secondLargest < ele:
                secondLargest = ele

        return secondLargest


